import { useState } from "react";
import { useNavigate } from "react-router-dom";
import "../styles/Auth.css";

const Auth = () => {
  const [isSignup, setIsSignup] = useState(false);
  const [role, setRole] = useState("Lecturer"); // üëà ÿßÿÆÿ™Ÿäÿßÿ± ÿßŸÑÿØŸàÿ±
  const navigate = useNavigate();

  // ÿ®ŸäÿßŸÜÿßÿ™ ÿßŸÑÿ£ÿØŸÖŸÜ ÿßŸÑÿ´ÿßÿ®ÿ™ÿ©
  const ADMIN_EMAIL = "mariaalabed6@gmail.com";
  const ADMIN_PASSWORD = "4444";

  /* ===================== ÿ™ÿ≥ÿ¨ŸäŸÑ ÿßŸÑÿØÿÆŸàŸÑ ===================== */
  const handleLogin = (e) => {
    e.preventDefault();

    const email = e.target.email.value;
    const password = e.target.password.value;

    // ÿØÿÆŸàŸÑ ÿ£ÿØŸÖŸÜ
    if (role === "admin") {
      if (email === ADMIN_EMAIL && password === ADMIN_PASSWORD) {
        localStorage.setItem("role", "admin");
        navigate("/admin");
      } else {
        alert("Invalid admin credentials");
      }
    }

    // ÿØÿÆŸàŸÑ ÿØŸÉÿ™Ÿàÿ± (ÿØŸäŸÖŸà)
    if (role === "Lecturer") {
      localStorage.setItem("role", "Lecturer");
      navigate("/Lecturer");
    }
  };

  /* ===================== ÿ•ŸÜÿ¥ÿßÿ° ÿ≠ÿ≥ÿßÿ® ===================== */
  const handleSignup = (e) => {
    e.preventDefault();

    // ÿ•ŸÜÿ¥ÿßÿ° ÿ≠ÿ≥ÿßÿ® ÿØŸÉÿ™Ÿàÿ± ŸÅŸÇÿ∑
    alert("Lecturer account created successfully (demo)");
    setIsSignup(false); // ÿ±ÿ¨Ÿàÿπ ŸÑÿµŸÅÿ≠ÿ© ÿ™ÿ≥ÿ¨ŸäŸÑ ÿßŸÑÿØÿÆŸàŸÑ
  };

  return (
    <div className="login-container">
      <img
        src={process.env.PUBLIC_URL + "/images/background.png"}
        className="background-image"
        alt="AI Eye"
      />

      <div className={`cards-wrapper ${isSignup ? "signup-mode" : ""}`}>
        {/* ================= ÿßŸÑŸÉÿ±ÿ™ ÿßŸÑŸäÿ≥ÿßÿ± ================= */}
        <div className="login-card">
          <div className="card-content">
            {!isSignup ? (
              <>
                <h1 className="login-title">Welcome</h1>
                <p className="login-subtitle">
                  Smart Classroom Attention Monitoring System
                </p>
              </>
            ) : (
              <>
                <h1 className="login-title">Create Lecturer Account</h1>
                <p className="login-subtitle">
                  Sign up as a Lecturer to start monitoring
                </p>
              </>
            )}
          </div>
        </div>

        {/* ================= ÿßŸÑŸÉÿ±ÿ™ ÿßŸÑŸäŸÖŸäŸÜ ================= */}
        <div className="login-card">
          <div className="card-content">
            {/* ================= Sign In ================= */}
            {!isSignup ? (
              <>
                <h1 className="login-title">Sign In</h1>

                <form className="login-form" onSubmit={handleLogin}>
                  {/* ÿßÿÆÿ™Ÿäÿßÿ± ÿßŸÑÿØŸàÿ± */}
                  <select
                    className="login-input"
                    value={role}
                    onChange={(e) => setRole(e.target.value)}
                  >
                    <option value="Lecturer">Lecturer</option>
                    <option value="admin">Admin</option>
                  </select>

                  <input
                    name="email"
                    className="login-input"
                    placeholder="Email"
                    required
                  />

                  <input
                    name="password"
                    type="password"
                    className="login-input"
                    placeholder="Password"
                    required
                  />

                  <button className="login-btn">Login</button>
                </form>

                <p className="signup-text">
                  Don‚Äôt have an account?
                  <span onClick={() => setIsSignup(true)}>
                    {" "}
                    Create Lecturer account
                  </span>
                </p>
              </>
            ) : (
              /* ================= Sign Up (Doctor only) ================= */
              <>
                <h1 className="login-title">Sign Up</h1>

                <form className="login-form" onSubmit={handleSignup}>
                  <input
                    className="login-input"
                    placeholder="Full name"
                    required
                  />

                  <input
                    name="email"
                    className="login-input"
                    placeholder="Email"
                    required
                  />

                  <input
                    type="password"
                    className="login-input"
                    placeholder="Password"
                    required
                  />

                  <button className="login-btn">Create Account</button>
                </form>

                <p className="signup-text">
                  Already have an account?
                  <span onClick={() => setIsSignup(false)}> Sign In</span>
                </p>
              </>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Auth;
